import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <header>
      <div className="container">
        <Link to="/">
          <h1>Workout Buddy</h1>
        </Link>
        <Link to="/workout">
          <h1>Exercise</h1>
        </Link>
      </div>
    </header>
  );
};

export default Navbar;
